import React from 'react';

class ClassComponent extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            count: 0,
        };
    }

    incrementCount() {
        this.setState({count: this.state.count + 1});
    }

    decrementCount() {
        this.setState({count: this.state.count - 1});
    }

    render() {
        return (
            <div>
                <h1>{this.count}</h1>
                <button onClick={incrementCount}>Увеличить говно</button>
                <button onClick={decrementCount}>Уменьшить говно</button>
            </div>
        )
    }
}

export default ClassComponent;
